import React from "react";
import InputFields from "../../../../Components/InputField/index";
const Forms = () => {
  return (
    <div>
      <div>
        <p>Welcome to <span></span></p>
      </div>
      <div>
        <InputFields type={"text"} placeholder={"User name"} />
        <InputFields type={"password"} placeholder={"password"} />
      </div>
    </div>
  );
};

export default Forms;
